import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import './App.css';
import LoginScreen from './components/LoginScreen';

function App() {
  return (
    <Router>
      <Route exact path={"/"}>
        <LoginScreen />
      </Route>
    </Router>
  );
}

export default App;
